import Vue from 'vue'
import VueRouter from 'vue-router'
import App from './App.vue'
import router from './router'

const APP_ID = 'app';
const appElement = document.createElement('div');
appElement.id = APP_ID;
document.body.appendChild(appElement);

new Vue({
  el: '#' + APP_ID,
  render: (h) => h(App),
  router,
})
